                        "Name": "Искусство Юху: Сумасшествие Мудзина",
                        "Desc": "Другая невероятная техника искусства Юху! Она призывает на помощь Саю пару умелых рук.<br>Наносит <color style='color:#80FFD7;'>Анемо урон</color> окружающим противникам и лечит всех ближайших членов отряда. Количество восстановленного HP зависит от силы атаки Саю. Затем этот навык призывает Мудзи-Мудзи Даруму.<br><br><color style='color:#FFD780;'>Мудзи-Мудзи Дарума</color><br>Через определённые промежутки времени в зависимости от ситуации Дарума будет исполнять одно из следующих действий:<br> ·  Если HP ближайших персонажей выше 70%, он атакует ближайшего противника, нанося <color style='color:#80FFD7;'>Анемо урон</color>.<br> ·  Если рядом есть персонажи с HP равным 70% или ниже, он лечит персонажа с наименьшим оставшимся количеством HP. Если поблизости нет противников, а HP ближайших персонажей выше 70%, то он просто лечит персонажей.<br><br><i>Ничего не знающие о ниндзюцу люди любят смотреть, как Саю демонстрирует это умение, и некоторые даже пытаются научиться у неё. Но сама Саю просто хочет, чтобы ей дали поспать и не тревожили.</i>",
